import data from "../data/"

const SelectType = props => {

    return (
        <>
            <h6>Type of Note:</h6>
            <div class="custom-control custom-radio custom-control-inline">
                <input type="radio" id="customRadioInline1" name="customRadioInline1" class="custom-control-input" value={NOTE_TYPE.TEXT}  onChange={(e) => props.callback(e.target.value)}/>
                <label class="custom-control-label" for="customRadioInline1">Text</label>
            </div>
            <div class="custom-control custom-radio custom-control-inline">
                <input type="radio" id="customRadioInline2" name="customRadioInline1" class="custom-control-input" value={NOTE_TYPE.LINK} onChange={(e) => props.callback(e.target.value)}/>
                <label class="custom-control-label" for="customRadioInline2">Link</label>
            </div>
        </>
    )
}

export default SelectType;
